import {SERVER_URL} from "./constant";
import {useEffect, useState} from "react";

function Car() {

    const [cars, setCars] = useState()

    const getCars = async()=> {

        const response = await fetch(
            SERVER_URL + '/car'
        ).then((response) => response.json());

      setCars(response);
    }

    useEffect(() => {getCars()}, []);
    return (
        <table class="styled-table">
            <tr>
                <th>Brand</th>
                <th>Model</th>
                <th>Year</th>
            </tr>
            {cars && cars.map((car) =>
            <tr key={car.id}>
                <th>{car.brand}</th>
                <th>{car.model}</th>
                <th>{car.year}</th>
            </tr>
            )}
        </table>
    );
}

export default Car;
